import * as React from 'react';
import Button from '@material-ui/core/Button';

class PolicySelect extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            requiredItem: 0,
            data: [
                {
                    "Id": 1,
                    "Name": "Key Management"
                },
                {
                    "Id": 2,
                    "Name": "Role Management"
                },
                {
                    "Id": 3,
                    "Name": "Resource Management"
                }
            ]
        }
    }
    render () {
        return (
            <Button
  onClick={() => {
    alert('clicked');
  }}
>
  Click me
</Button>

        );
    }
}
export default PolicySelect;
